import React, { Component } from 'react';

export default class BoxClass extends Component {
    constructor(props) {
        super(props);
        // Initialize state or any other properties here if needed
        this.result = ""; // Initialize this.result
    }

    render() {
        console.log(this.result); // This will log an empty string initially
        return (
            <div className={`box ${this.result} main`}>
                <h1>{this.props.title}</h1>
                <img className='item-img' src={this.props.item && this.props.item.img} alt="" />
                {/* Null or undefined props.item will result in false, so the && operator works */}
                <p className={this.result}>{this.props.result}</p>
            </div>
        );
    }
}
